import HomePage from "./Page/Home/HomePage";
import { BrowserRouter ,  Routes , Route} from "react-router-dom";
import NavBarLogin from './Components/Utility/NaveBarLogin';
import Footer from './Components/Utility/Footer';
import LoginPage from "./Page/Auth/LoginPage";
import Rigester from "./Page/Auth/ResisterPage";
import AllCategoryPage from "./Page/Category/AllCategoryPage";
import AllBrand from "./Page/Brand/AllBrandPage";
function App() {
  return (
    <div className="font">
      <NavBarLogin/>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<HomePage/>} />
          <Route path="login" element={<LoginPage/>} />
          <Route path="register" element={<Rigester/>} />
          <Route path="allcategory" element={<AllCategoryPage/>} />
          <Route path="allcategory" element={<AllBrand/>} />
        </Routes>
      </BrowserRouter>
      <Footer/>
    </div>
  );
}

export default App;
